import { useUser } from "../hooks/user";
import Orders from "../components/orders";

function OrdersPage() {
  const { user } = useUser();

  if (!user) {
    return <p>Please log in to view your orders</p>;
  }

  return <Orders />;
}

export default OrdersPage();
